import axios from "axios";

const baseURL = "http://localhost:21309/api/";

export default function GetIdUser(Users) {
  debugger;
  axios
    .get(`${baseURL}ShoppingCart/Login/`, Users)
    .then(function (response) {
      Users.idUser = response.data;
    })
    .catch(function (error) {
      // handle error
      console.log(error);
    })
    .then(function () {
      // always executed
    });
}
